window.bookSummaryJSON = "<p>New intrigues, adventures, and stunning revelations fill the penultimate installment of #1 <i>New York Times</i> best-selling author Kresley Cole's electrifying Arcana Chronicles. </p> <p>In a world teetering on the edge.... </p> <p>When Evie receives life-changing - and possibly game-changing - news, she has trouble believing it. Why doesn't she feel any different? Is it possible someone she trusts might be lying? </p> <p>With enemies at every turn.... </p> <p>Tensions seethe inside the castle of lost time as Evie starts to doubt her own sanity. Answers can be found outside their stronghold, but will Death help her find them - or prevent her from learning the truth about her future and Jack's possible survival? </p> <p>Darkness beckons. </p> <p>A mysterious, sinister power begins to affect the Arcana in its path. Forced out into the wasteland alone, Evie must depend on unexpected allies. But as a battle with Richter looms, can her new alliance defeat the Dark Calling before hell reigns on earth?</p>"; 
